When our State Keeper processes a transaction, it carries out a bunch of operations and assumes certain conditions without openly stating them. However, when it comes to ZK, we need to show clear evidence that these conditions hold. Take this simple example where we have a command that retrieves some data from storage and assigns it to a variable. a := SLOAD(0x100) In normal circumstances, the system would just read the data from storage and assign it. But in ZK, we need to provide evidence of what specific data was fetched and that it was indeed present in the storage beforehand. From the ZK point of view, this looks like: circuit inputs:
* current_state_hash = 0x1234;
* read_value: 44
* merkle_path proving that (0x100, 44) exists in tree with storage hash 0x1234
circuit outputs:
* new state hash (that includes the leaf saying that variable 'a' has value 44) Note : In reality, we also use multiple Queues with hashes (together with merkle trees), to track all the memory & storage accesses. So, in our example, what seems like a simple action actually requires us to create a bunch of hashes and merkle paths. This is precisely what the Witness Generator does. It processes the transactions, one operation at a time, and generates the necessary data that will be used later in circuits. A Closer Look Now let’s dive into a specific example witness_example : pub fn compute_decommitter_circuit_snapshots< E: Engine, R: CircuitArithmeticRoundFunction<E, 2, 3>,
>(
...
) -> ( Vec<CodeDecommitterCircuitInstanceWitness<E>>, CodeDecommitmentsDeduplicatorInstanceWitness<E>,
) In this code snippet, we're looking at a function named compute_decommitter_circuit_snapshots. It uses some technical terms and concepts that may seem daunting, but let's break them down: Engine: This is a trait that specifically handles complex mathematical curves, called Elliptic curves. It’s like your uint64 on steroids! CircuitArithmeticRoundFunction: This is a special kind of hashing function that's more suited for the circuits we are using than the regular ones like keccak. In our case, we use Franklin and Rescue from franklin repo . The function returns Witness classes, that contain queues such as FixedWidthEncodingSpongeLikeQueueWitness which hold the hashes we mentioned earlier. This is similar merkle paths that we discussed above. Where is the Code The job of generating witnesses, which we discussed earlier, is handled by the witness generator. Initially, this was located in a module zksync core witness. However, for the new proof system, the team began to shift this function to a new location called separate witness binary . Inside this new location, after the necessary data is fetched from storage, the witness generator calls another piece of code from zkevm_test_harness witness named run_with_fixed_params. This code is responsible for creating the witnesses themselves (which can get really HUGE).

