If you look at boojum repo (src/cs/traits/cs.rs): pub trait ConstraintSystem<F: SmallField>: Send + Sync { ... fn alloc_variable() -> Variable; fn alloc_witness_without_value(&mut self) -> Witness; fn place_gate<G: Gate<F>>(&mut self, gate: &G, row: usize); ...
} We have three main components: Variable, Witness, and Gate. To understand the constraint system, imagine it as a list of "placeholders" called Variables. We define rules, referred to as "gates" for these Variables. The Witness represents a specific assignment of values to these Variables, ensuring that the rules still hold true. Conceptually, this is similar to how we implement functions. Consider the following example: fn fun(x) { y = x + A; z = y * B; w = if y { z } else { y }
} In this code snippet, A, B, y, z, and w are Variables (with A and B being constants). We establish rules, or gates, specifying that the Variable z must equal y multiplied by the Variable B. Example Witness assignment would be: x = 1; A = 3; y = 3; B = 0; z = 0; w = 3; Gates can become more complex. For instance, the w case demonstrates a "selection" gate, which chooses one of two options depending on a condition. Now, let's delve into this gate for a more detailed examination: Selection gate The code is in boojum/src/cs/gates/selection_gate.rs Let's delve deeper into the concept. Our goal is to create a gate that implements the logic result = if selector == true a else b;. To accomplish this, we will require four variables. pub struct SelectionGate { pub a: Variable, pub b: Variable, pub selector: Variable, pub result: Variable,
} Internally the Variable object is pub struct Variable(pub(crate) u64); - so it is an index to the position within the constraint system object. And now let's see how we can add this gate into the system. pub fn select<F: SmallField, CS: ConstraintSystem<F>>( cs: &mut CS, a: Variable, b: Variable, selector: Variable,
) -> Variable { // First, let's allocate the output variable: let output_variable = cs.alloc_variable_without_value(); ...
} And then there is a block of code for witness evaluation (let's skip it for now), and the final block that adds the gate to the constraint system cs: if <CS::Config as CSConfig>::SetupConfig::KEEP_SETUP { let gate = Self { a, b, selector, result: output_variable, }; gate.add_to_cs(cs); } output_variable So to recap - we took 3 'Variables', created the output one, created a SelectionGate object out of them, which we added to the system (by calling add_to_cs) - and the finally returned the output variable. But where is the 'logic'? Where do we actually enforce the constraint? For this, we have to look at the Evaluator: impl<F: SmallField> Gate<F> for SelectionGate { type Evaluator = SelectionGateConstraitEvaluator; #[inline] fn evaluator(&self) -> Self::Evaluator { SelectionGateConstraitEvaluator }
} impl<F: PrimeField> GateConstraitEvaluator<F> for SelectionGateConstraitEvaluator { fn evaluate_once{ let a = trace_source.get_variable_value(0); let b = trace_source.get_variable_value(1); let selector = trace_source.get_variable_value(2); let result = trace_source.get_variable_value(3); // contribution = a * selector let mut contribution = a; contribution.mul_assign(&selector, ctx); // tmp = 1 - selector let mut tmp = P::one(ctx); tmp.sub_assign(&selector, ctx); // contribution += tmp * b // So: // contribution = a*selector + (1-selector) * b P::mul_and_accumulate_into(&mut contribution, &tmp, &b, ctx); // contribution = a*selector + (1-selector) * b - result contribution.sub_assign(&result, ctx); // And if we're successful, the contribution == 0. // Because result == a * selector + (1-selector) * b destination.push_evaluation_result(contribution, ctx); }
} This evaluator is actually operating on top of the Field objects, trying to build & evaluate the correct polynomials. The details of it will be covered in a separate article. Congratulations, you hopefully understood the code for the first gate. To recap - we created the 'output' Variable, and added the Gate to the CS system. Later when CS system 'computes' all the dependencies, it will run the constraint evaluator, to add the 'raw' dependency (which is basically an equation) to the list. You can look into other files in src/cs/gates to see other examples.

