Now, that we handled the basic variables, let's see what we can do with more complex structures. Boojum has added a bunch of derive macros, to make development easier. Let's look at the example: #[derive(Derivative, CSSelectable, CSAllocatable, CSVarLengthEncodable, WitnessHookable)]
pub struct VmLocalState<F: SmallField> { pub previous_code_word: UInt256<F>, pub registers: [VMRegister<F>; REGISTERS_COUNT], pub flags: ArithmeticFlagsPort<F>, pub timestamp: UInt32<F>, pub memory_page_counter: UInt32<F>, First - all the UInt that you see above, are actually implemented in Boojum: pub struct UInt32<F: SmallField> { pub(crate) variable: Variable,
}
impl<F: SmallField> CSAllocatable<F> for UInt32<F> { // So the 'witness' type (concrete value) for U32 is u32 - no surprises ;-) type Witness = u32; ...
} pub struct UInt256<F: SmallField> { pub inner: [UInt32<F>; 8],
} WitnessHookable In the example above, the Witness type for U32, was u32 - easy. But what should we do, when we have more complex struct (like VmLocalState)? This derive will automatically create a new struct named XXWitness (in example above VmLocalStateWitness), that can be filled with concrete values. CsAllocatable Implements CsAllocatable - which allows you to directly 'allocate' this struct within constraint system (similarly to how we were operating on regular 'Variables' above). CSSelectable Implements the Selectable trait - that allows this struct to participate in operations like conditionally select (so it can be used as 'a' or 'b' in the Select gate example above). CSVarLengthEncodable Implements CircuitVarLengthEncodable - which allows encoding the struct into a vector of variables (think about it as serializing to Bytes). Summary Now with the tools above, we can do operations on our constraint system using more complex structures. So we have gates as 'complex operators' and structures as complex object. Now we're ready to start taking it to the next level: Circuits.

