The main contract of the whole ZK Chains ecosystem is called BridgeHub . It contains: the registry from chainId to CTMs that is responsible for that chainId the base token for each chainId. the whitelist of CTMs the whitelist of tokens allowed to be baseTokens of chains. the whitelist of settlement layers etc BridgeHub is responsible for creating new chains. It is also the main point of entry for L1→L2 transactions for all the chains. Users won't be able to interact with chains directly, all the actions must be done through the BridgeHub, which will ensure that the fees have been paid and will route the call to the corresponding chain. One of the reasons it was done this way was to have the unified interface for all chains that will ever be included in the ZK Chains ecosystem. To create a chain, the BridgeHub.createNewChain function needs to be called: /// @notice register new chain. New chains can be only registered on Bridgehub deployed on L1. Later they can be moved to any other layer.
/// @notice for Eth the baseToken address is 1
/// @param _chainId the chainId of the chain
/// @param _chainTypeManager the state transition manager address
/// @param _baseTokenAssetId the base token asset id of the chain
/// @param _salt the salt for the chainId, currently not used
/// @param _admin the admin of the chain
/// @param _initData the fixed initialization data for the chain
/// @param _factoryDeps the factory dependencies for the chain's deployment
function createNewChain( uint256 _chainId, address _chainTypeManager, bytes32 _baseTokenAssetId, // solhint-disable-next-line no-unused-vars uint256 _salt, address _admin, bytes calldata _initData, bytes[] calldata _factoryDeps
) external BridgeHub will check that the CTM as well as the base token are whitelisted and route the call to the CTM newChain (2).png Creation of a chain in the current release In the future, chain creation will be permissionless. A securely random chainId will be generated for each chain to be registered. However, generating 32-byte chainId is not feasible with the current SDK expectations on EVM and so for now chainId is of type uint48. And so it has to be chosen by the admin of BridgeHub. Also, for the current release we would want to avoid chains being able to choose their own initialization parameter to prevent possible malicious input. For this reason, there will be an entity called admin which is basically a hot key managed by us and it will be used to deploy new chains. So the flow for deploying their own chain for users will be the following: Users tell us that they want to deploy a chain with certain governance, CTM (we’ll likely allow only one for now), and baseToken. Our server will generate a chainId not reserved by any other major chain and the admin will call the BridgeHub.createNewChain . This will call the CTM.createNewChain that will deploy the instance of the rollup as well as initialize the first transaction there — the system upgrade transaction needed to set the chainId on L2. After that, the chain is ready to be used. Note, that the admin of the newly created chain (this will be the organization that will manage this chain from now on) will have to conduct certain configurations before the chain can be used securely .

